    "2015-09-26T23:45:22.138535",nt"name": "braden-river-aerial-topographic-mapping",nt"isopen":
    false,nt"url": null,nt"notes": "This metadata record describes the ortho
    & LIDAR mapping of the Braden River area, FL. The mapping consists of LIDAR data
    collection, contour generation, and production of natural color orthophotography
    with a 1ft pixel using imagery collected with a Wild RC-30 Aerial Camera. Additionally,
    this area was collected at a 30-cm GSD using color imagery collected with a Leica
    ADS-40 Aerial Digital Camera as part of the Sarasota County project area. More information
    on the ADS-40 imagery collected over Braden River can be found in the metadata for
    the Sarasota County project.",nt"license_title": null,nt"extras": [{ntt"key":
